const divStyle = {
  //paddingBottom: 100,
  position: 'relative',
}
const btnDivStyle = {
  position: 'absolute',
	top: '40%',
  left: '13%',
}


const Banner = props => (
  <div style={divStyle}>
    <img style={imgStyle} src="../static/banner.jpg" alt="Banner Image"/>
    <div style={btnDivStyle}>
      <text style={btnStyle1}>Amazon</text>
      <text style={btnStyle2}>Naver Shopping</text>
      <text style={btnStyle3}>Shopee</text>
    </div>
  </div>
);
